import React from "react";
import styled from "styled-components";
import searchIcon from "../images/search.png";
import { BsPerson, BsSearch, BsMoon } from "react-icons/bs";

export default function AppBar() {
  return (
    <div>
      <AppBarBox>
        <AppBarTop>
          {" "}
          <Login>로그인</Login>
          <SelfInfo>
            <BsPerson />
          </SelfInfo>
        </AppBarTop>
        <AppBarDiv>
          <Logo> ⏣ 오늘 뭐 볼까 ?</Logo>
          <SearchBoxDiv>
            <SearchDiv>
              {" "}
              무엇을 검색하시겠습니까 ?
              {/* <input type="text" value={search} onChange={onChange} /> */}
            </SearchDiv>
            <SearchButton>
              <Search>
                <BsSearch />
              </Search>
            </SearchButton>
          </SearchBoxDiv>
          <MenuBoxDiv>
            <MenuDiv onClick={<Services/>}> 추천 </MenuDiv>
            <MenuDiv> Top20 </MenuDiv>
            <MenuDiv> 게시판 </MenuDiv>
          </MenuBoxDiv>
          <Mode>
            <BsMoon />
          </Mode>
        </AppBarDiv>
      </AppBarBox>
    </div>
  );
}
const AppBarBox = styled.div`
  background: linear-gradient(to bottom, #000000, #4f4f51);
`;
const AppBarTop = styled.div`
  display: flex;
  justify-content: flex-end;
  padding: 0px 40px 0px 10px;
  color: white;
`;
const Login = styled.div`
  padding: 10px;
  justify-content: center;
  align-self: center;
  cursor: pointer;
`;
const SelfInfo = styled.div`
  font-size: 30px;
  padding: 5px;
  cursor: pointer;
`;
const AppBarDiv = styled.div`
  display: flex;
  color: white;
  font-size: 20px;
  border-top: solid 3px white;
  border-bottom: solid 3px white;
  align-items: center;
  justify-content: space-between;
  height: 70px;
  padding: 0 20px;
  box-shadow: 0px 1px 5px rgba(0, 0, 0, 0.1);
  border: 1px solid #ccc;
`;
const Logo = styled.div`
  font-size: 30px;
  padding: 20px;
  cursor: pointer;
`;
const SearchBoxDiv = styled.div`
  display: flex;
  border-left: solid 2px white;
  border-right: solid 2px white;
`;

const SearchDiv = styled.div`
  padding: 16px 230px 12px 27px;
  /* padding-right: 79px; */
  font-size: 20px;
  color: grey;
`;

const SearchButton = styled.button`
  background-color: transparent;
  color: white;
  border: none;
  padding: 10px 20px;
  font-size: 20px;
  opacity: 0.5;
`;

const Search = styled.div`
  font-size: 25px;
  color: white;
  cursor: pointer;
`;
const MenuBoxDiv = styled.div`
  display: flex;
  justify-content: flex-start;
  font-size: 20px;
  font-weight: bolder;
  cursor: pointer;
`;
const Mode = styled.div`
  font-size: 40px;
  cursor: pointer;
`;
const MenuDiv = styled.div`
  padding: 0px 40px 0px 0px;
`;
